import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  const [open, setOpen] = useState(false);

  return (
    <nav className="navbar">
      {/* Logo */}
      <Link to="/" className="logo" onClick={() => setOpen(false)}>
        <img src="/logo.png" alt="Sri Gaviranga Logo" />
        <span>Sri Gaviranga</span>
      </Link>

      {/* Hamburger */}
      <button
        className="hamburger"
        onClick={() => setOpen(!open)}
        aria-label="Toggle menu"
      >
        <span></span>
        <span></span>
        <span></span>
      </button>

      {/* Menu */}
      <ul className={`nav-links ${open ? "show" : ""}`}>
        <li><Link to="/" onClick={() => setOpen(false)}>Home</Link></li>
        <li><Link to="/services" onClick={() => setOpen(false)}>Services</Link></li>
        <li><Link to="/about" onClick={() => setOpen(false)}>About</Link></li>
        <li><Link to="/contact" onClick={() => setOpen(false)}>Contact</Link></li>

        <li>
          <Link
            className="book-btn"
            to="/book-appointment"
            onClick={() => setOpen(false)}
          >
            Book Appointment
          </Link>
        </li>

        <li className="dropdown">
          <span>Login â–¾</span>
          <div className="dropdown-menu">
            <Link to="/login" onClick={() => setOpen(false)}>User Login</Link>
            <Link to="/admin-login" onClick={() => setOpen(false)}>Admin Login</Link>
          </div>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
